request.description:
The endpoint makes an HTTP GET request to retrieve a list of students based on the provided major code, entry year, and page number. The response contains a JSON object with the fields code, error, message, and data. The data field includes an array of student objects with various attributes such as id, nim, name, status_process, last_status, current_status, academic_supervisor, entry_year, period, and more.

Here is a JSON schema representing the response:

``` json
{
  "type": "object",
  "properties": {
    "code": { "type": "number" },
    "error": { "type": "boolean" },
    "message": { "type": "string" },
    "data": {
      "type": "object",
      "properties": {
        "per_page": { "type": "number" },
        "data": {
          "type": "array",
          "items": {
            "type": "object",
            "properties": {
              "id": { "type": "string" },
              "nim": { "type": "string" },
              "name": { "type": "string" },
              "status_process": {
                "type": "object",
                "properties": {
                  "semester_id": { "type": "string" },
                  "semester_name": { "type": "string" },
                  "timeline": {
                    "type": "array",
                    "items": { "type": "string" }
                  }
                }
              },
              "last_status": {
                "type": "object",
                "properties": {
                  "id": { "type": ["string", "null"] },
                  "semester_name": { "type": "string" },
                  "semester_id": { "type": "string" },
                  "payment_method": { "type": "string" },
                  "payment_amount": { "type": ["number", "null"] },
                  "status": { "type": "string" },
                  "main_degree": { "type": ["string", "null"] },
                  "sub_degree": { "type": ["string", "null"] },
                  "file_decree": { "type": ["string", "null"] },
                  "number_decree": { "type": ["string", "null"] },
                  "date_decree": { "type": ["string", "null"] },
                  "date_exit": { "type": ["string", "null"] },
                  "date_of_death": { "type": ["string", "null"] },
                  "note": { "type": ["string", "null"] },
                  "title_thesis_id": { "type": ["string", "null"] },
                  "title_thesis_en": { "type": ["string", "null"] },
                  "major_code_destination": { "type": ["string", "null"] },
                  "major_name_destination": { "type": ["string", "null"] },
                  "faculty_id_destination": { "type": ["string", "null"] },
                  "faculty_name_destination": { "type": ["string", "null"] },
                  "predicate": { "type": ["string", "null"] },
                  "approved_by": { "type": ["string", "null"] },
                  "ijazah_number": { "type": ["string", "null"] },
                  "alumni_number": { "type": ["string", "null"] },
                  "eligible": { "type": ["string", "null"] },
                  "complete_requirement": { "type": ["string", "null"] }
                  // ... (other attributes)
                }
              },
              // ... (other attributes)
            }
          }
        },
        "total_page": { "type": "number" },
        "total_data": { "type": "number" },
        "page": { "type": "number" }
      }
    }
  }
}

 ```
